import React from "react";
import Dashboard from "./components/Dashboard";
import SafeRoutes from "./components/SafeRoutes";
import VoiceAlert from "./components/VoiceAlert";

function App() {
  return (
    <div>
      <h1>Women Safety Analytics Dashboard</h1>
      <Dashboard />
      <SafeRoutes />
      <VoiceAlert />
    </div>
  );
}

export default App;
